import image from './images/tryunfo-img.png'

const objectRepo = [{
        url: 'https://rodrigopaaz.github.io/project-trybe-wallet/',
        image: './images/tryunfo-img.png',
        descricao: 'Trybe Wallet',
    },
    {
        url: 'https://rodrigopaaz.github.io/project-trybe-tunes/',
        image: image,
        descricao: 'Trybe Tunes',
    },
    {
        url: 'https://rodrigopaaz.github.io/project-tryunfo/',
        image: './images/trybe-wallet-img.png',
        descricao: 'Tryunfo',
    },
    {
        url: 'https://rodrigopaaz.github.io/project-recipes-app/',
        image: './images/tryunfo-img.png',
        descricao: 'Recipes App',
    }
    ]
  export default objectRepo;
